  ["saturate"] = "<html><body><h1>saturate</h1><p>v. cause (a chemical compound, vapour, solution, magnetic material) to unite with the greatest possible amount of another substance</p><p>vt. 使渗透, 浸透, 使充满, 使饱和<p></p>a. 浸透的, 饱和度高的, 深颜色的<p></p>n. 饱和化合物, 饱和脂肪酸</p></body></html>",
  ["saturated"] = "<html><body><h1>saturated</h1><p>a. being the most concentrated solution possible at a given temperature; unable to dissolve still more of a substance<p></p>a. used especially of organic compounds; having all available valence bonds filled<p></p>a. (of color) being chromatically pure; not diluted with white or grey or black</p><p>a. 饱和的, 渗透的<p></p>[医] 饱和的</p></body></html>",
