  ["shall"] = "<html><body><h1>shall</h1><p>v. i. & auxiliary. To owe; to be under obligation for.<p></p>v. i. & auxiliary. To be obliged; must.<p></p>v. i. & auxiliary. As an auxiliary, shall indicates a duty or<p></p>   necessity whose obligation is derived from the person speaking; as, you<p></p>   shall go; he shall go; that is, I order or promise your going. It thus<p></p>   ordinarily expresses, in the second and third persons, a command, a<p></p>   threat, or a promise. If the auxillary be emphasized, the command is<p></p>   made more imperative, the promise or that more positive and sure. It is<p></p>   also employed in the language of prophecy; as, &quot;the day shall come when<p></p>   . . . , &quot; since a promise or threat and an authoritative prophecy<p></p>   nearly coincide in significance. In shall with the first person, the<p></p>   necessity of the action is sometimes implied as residing elsewhere than<p></p>   in the speaker; as, I shall suffer; we shall see; and there is always a<p></p>   less distinct and positive assertion of his volition than is indicated<p></p>   by will. &quot;I shall go&quot; implies nearly a simple futurity; more exactly, a<p></p>   foretelling or an expectation of my going, in which, naturally enough,<p></p>   a certain degree of plan or intention may be included; emphasize the<p></p>   shall, and the event is described as certain to occur, and the<p></p>   expression approximates in meaning to our emphatic &quot;I will go.&quot; In a<p></p>   question, the relation of speaker and source of obligation is of course<p></p>   transferred to the person addressed; as, &quot;Shall you go?&quot; (answer, &quot;I<p></p>   shall go&quot;); &quot;Shall he go?&quot; i. e., &quot;Do you require or promise his<p></p>   going?&quot; (answer, &quot;He shall go&quot;.) The same relation is transferred to<p></p>   either second or third person in such phrases as &quot;You say, or think,<p></p>   you shall go;&quot; &quot;He says, or thinks, he shall go.&quot; After a conditional<p></p>   conjunction (as if, whether) shall is used in all persons to express<p></p>   futurity simply; as, if I, you, or he shall say they are right. Should<p></p>   is everywhere used in the same connection and the same senses as shall,<p></p>   as its imperfect. It also expresses duty or moral obligation; as, he<p></p>   should do it whether he will or not. In the early English, and hence in<p></p>   our English Bible, shall is the auxiliary mainly used, in all the<p></p>   persons, to express simple futurity. (Cf. Will, v. t.) Shall may be<p></p>   used elliptically; thus, with an adverb or other word expressive of<p></p>   motion go may be omitted.</p><p>aux. 将</p></body></html>",
