  ["smotherers"] = "<html><body><h1>smotherers</h1><p>smotherer<p></p>n.<p></p>smother的变形<p></p>smother<p></p>['smʌðə]<p></p>vt.<p></p>使窒息，令…透不过气；把…闷死：<p></p>to be smothered by the heavy smoke<p></p>被浓烟呛得透不过气<p></p>I went out of the meeting room; the atmosphere there smothered me.<p></p>我走出了会议室，那里的气氛令我透不过气来。<p></p>把(火)盖熄，闷住(火等)：<p></p>to smother the fire with ash<p></p>用灰盖住火<p></p>笼罩，覆盖：<p></p>to smother the top of the mountain with white clouds<p></p>山头笼罩在白云之中<p></p>to smother the cake with thick cream<p></p>给蛋糕盖上厚厚一层奶油<p></p>压制，平息；抑制：<p></p>to smother one's tears<p></p>忍住悲伤<p></p>to smother feelings<p></p>抑制住情感<p></p>把…镇住；使大败：<p></p>She was smothered by his despotic power.<p></p>她被他的淫威镇住了。<p></p>to smother the home team<p></p>使主队大败<p></p>(把…)过多地给予(with):<p></p>It's no good smothering the children with money.<p></p>给孩子过多的钱不利于孩子的成长。<p></p>【烹饪】熬，煮；炖，煨：<p></p>smothered chicken and mushrooms<p></p>蘑菇炖鸡<p></p>vi.<p></p>窒息，透不过气；闷死：<p></p>to smother to death<p></p>窒息而死<p></p>被忍住；被扼杀，被抑制：<p></p>Her anger smothered and she smiled at him.<p></p>她强忍住她的忿怒，并且还朝他笑了一笑。<p></p>The feelings that smothered burst all of a sudden.<p></p>被抑制的感情一下子爆发了。<p></p>His talent smothered in his trifles.<p></p>琐碎杂事扼杀了他的才能。<p></p>[方言] 闷烧，阴燃：<p></p>smothered wastes<p></p>阴燃的垃圾<p></p>n.<p></p>浓烟；令人窒息的浓烟(或尘埃、浓雾等)<p></p>窒息状态；被抑制状态；文火燃烧状态<p></p>一团浓雾(或尘埃等)<p></p>阴燃，闷燃<p></p>杂乱无章的一大堆；充斥，泛滥；混乱</p></body></html>",
