  ["spongeing"] = "<html><body><h1>spongeing</h1><p>sponge<p></p>[spʌndʒ]<p></p>n.<p></p>【动物】海绵[多孔动物门(Porifera)水生动物]<p></p>海绵丝(海绵的角质骨骼)；人造海绵<p></p>海绵状物<p></p>【冶金学】疏松多孔的金属，金属绵，海绵金属<p></p>(医用)纱布<p></p>(擦炮膛用的)炮刷<p></p>果冰<p></p>发酵面团<p></p>多孔布丁<p></p>= sponge cake<p></p>(海绵般)能大量吃喝的人，大酒量者；能大量吸收物体的东西<p></p>[口语]食客，寄生者<p></p>用海绵(或类似物)擦拭；擦浴，擦身浴<p></p>(蟹的)卵块<p></p>[用复数](核电站临时雇用的)吃射线工人[亦作 steam generator jumpers, jumpers]<p></p>vt.<p></p>用湿海绵揩擦：<p></p>Sponge the glass, then clean with a dry cloth.<p></p>先用湿海绵擦一下玻璃，然后用一块干布擦干净。<p></p>to sponge some dirty marks down<p></p>擦抹污渍<p></p>用海绵(或类似物)擦掉，抹去(out， away， off)：<p></p>He sponged a wrong letter off with a rubber.<p></p>他用橡皮擦掉了一个错误的字母。<p></p>Sponge away the water on the floor.<p></p>把地板上的积水擦一擦。<p></p>把…(用海绵等)吸干(up)；似海绵般把…吸收：<p></p>to sponge up ink<p></p>吸干墨水<p></p>The higher interest rate would sponge up a large number of deposits.<p></p>较高利率会吸引大量的存款。<p></p>(利用他人的善良、友谊等)强行借用；骗取：<p></p>He sponged some money from his friend and went to the bar.<p></p>他向朋友强行借了些钱，到酒吧喝酒去了。<p></p>[口语]寄食于(他人)，白吃白喝<p></p>(裁剪前)使润湿预缩水<p></p>【陶瓷】(用海绵沾颜料)修饰(陶制品)<p></p>vi.<p></p>(用海绵)吸干液体；似海绵般吸收<p></p>采集海绵<p></p>用海绵擦洗,被擦洗掉(off, away, out):<p></p>The words and drawings sponged off yesterday.<p></p>墙上的字和画昨天被擦掉了。<p></p>[口语]寄食他人，靠别人过活(on， off):<p></p>He sponged off his family for many years.<p></p>多年以来他一直靠着父母养活。<p></p>近义词:<p></p>parasite<p></p>短语:<p></p>lay(或 set) the sponge<p></p>发面<p></p>pass the (wet) sponge over<p></p>抹去；同意抛弃(前嫌等)<p></p>throw (或 chuck, toss) in (或up) the sponge<p></p>认输；投降<p></p>变形：<p></p>vt.<p></p>sponged<p></p>. sponging</p></body></html>",
