  ["squelchier"] = "<html><body><h1>squelchier</h1><p>squelchy<p></p>adj.<p></p>squelch的变形<p></p>squelch<p></p>[skweltʃ]<p></p>vt.<p></p>压碎，压烂；击碎：<p></p>The door was squelched by him.<p></p>屋门被他打碎了。<p></p>消除，打消；镇压，粉碎：<p></p>to squelch the feelings of fear<p></p>消除恐惧感<p></p>It is reported that the governmental troops have successfully squelched an armed coup.<p></p>据报道政府军成功地粉碎了一起武装政变。<p></p>使发出咯吱咯吱的声响；使咯吱咯吱响着前进<p></p>[口语]镇住，震慑；使缄默，使无言：<p></p>The two boxers glowered each other to squelch the other.<p></p>两位拳击手凶狠地互相瞪着眼想以此镇住对方。<p></p>【电子学】抑制(啸声)，使静噪<p></p>vi.<p></p>发出咯吱咯吱声，发出溅落声：<p></p>His boots squelched when he walked.<p></p>他走动时他的靴子发出咯吱咯吱的声音。<p></p>(在雪地、泥水等中)咯吱咯吱地走：<p></p>to squelch through the marsh<p></p>咯吱咯吱地走过沼泽地<p></p>n.<p></p>一堆压碎之物；压烂的一堆<p></p>咯吱声；溅落声<p></p>[口语]镇压，粉碎<p></p>[口语]压服；压制；令对方沉默的话语<p></p>= squelch circuit[亦作 noise suppressor]</p></body></html>",
