  ["stoopers"] = "<html><body><h1>stoopers</h1><p>stooper<p></p>n.<p></p>stoop1的变形<p></p>stoop1<p></p>[stu:p]<p></p>vi.<p></p>弯腰，俯身；弯着腰行走(或站立)：<p></p>He stooped and put down his gun.<p></p>他弯下腰放下了他的枪。<p></p>to stoop out of the car<p></p>弯腰走下了汽车<p></p>伛偻；弯腰曲背：<p></p>to stoop from age<p></p>因年老而弯腰弓背<p></p>屈身，屈尊；降低身份，自贬；堕落：<p></p>To my surprise,she stooped to come among us.<p></p>令我惊奇的是，她竟然屈尊来到了我们中间。<p></p>I won't stoop to argue with him.<p></p>我不会降低身份与他争吵的。<p></p>He never stooped to the place like that.<p></p>他决不会堕落到去那种地方。<p></p>(树木、悬崖等)前倾，倾斜<p></p>(鹰等捕猎时)俯冲下扑，飞扑<p></p>[古语]降落，下降<p></p>vt.<p></p>曲(身)，弯(腰)；使弯曲：<p></p>to stoop one's back<p></p>弯腰<p></p>[古语]使屈尊，使屈从；使自贬，使堕落<p></p>n.<p></p>弯腰，屈身<p></p>伛偻，驼背<p></p>屈尊；自贬，自卑；堕落<p></p>(鹰等)下扑<p></p>近义词:<p></p>condescend<p></p>. deign<p></p>短语:<p></p>stoop and roop<p></p>[苏格兰英语]彻底地，完全地<p></p>stoop to conquer<p></p>屈尊忍辱以达目的<p></p>stoop to something<p></p>委曲以求，曲意迎合<p></p>降低身份(或堕落到)做某事</p></body></html>",
