  ["supposer"] = "<html><body><h1>supposer</h1><p>[网络] 提供者</p></body></html>",
  ["supposers"] = "<html><body><h1>supposers</h1><p>supposer<p></p>n.<p></p>suppose的变形<p></p>suppose<p></p>[sə'pəuz]<p></p>vt.<p></p>假使，假定：<p></p>Supposing he isn't out, how can I do then?<p></p>假定他没出去，我该怎么办呢?<p></p>Let's first suppose the second defense line has been destroyed.<p></p>我们先来假定这第二条防线已被摧毁。<p></p>[用于祈使句]让：<p></p>Suppose we wait until tomorrow.<p></p>咱们就等到明天吧。<p></p>Suppose I tell you.<p></p>我来告诉你吧。<p></p>猜想，推测：<p></p>I suppose he'll come back now.<p></p>我想他这会儿该回来了。<p></p>You can't suppose whom I met in the street.<p></p>你准猜不着我在大街上看见谁啦。<p></p>认为，以为：<p></p>What do you suppose I will do?<p></p>你认为我会做什么?<p></p>意味着；说明(或证明)…的事实(或情况)：<p></p>The number of the cars supposes that the city traffic would get busier and busier.<p></p>这些汽车的数量意味着该市的交通会越来越拥挤。<p></p>That doesn't suppose you were absent at the scene of the crime.<p></p>那并不能说明你不在犯罪现场。<p></p>假定…的存在；需要…的存在为先决条件：<p></p>First, we have to suppose that she was out to make money.<p></p>首先，我们得假定她抛头露面是为了赚钱。<p></p>[用于被动语态]认为应该，认为必须；认为…必要；[口语]认为可以：<p></p>I'm not supposed to be at<p></p>the party.<p></p>我不该在聚会上露面。<p></p>The motorbike is supposed to make annoying noise.<p></p>摩托车当然会发出令人感到烦恼的噪音。<p></p>vi.<p></p>猜想，料想；认为：<p></p>猜想，料想；认为：<p></p>No need to suppose about.<p></p>没必要胡乱猜疑。<p></p>Say as you suppose.<p></p>怎么想的就怎么说。<p></p>conj.<p></p>假使，假如<p></p>假使…结果如何(或怎样)<p></p>变形：<p></p>vt.<p></p>supposed<p></p>. supposing</p></body></html>",
