  ["swayers"] = "<html><body><h1>swayers</h1><p>swayer<p></p>n.<p></p>sway的变形<p></p>sway<p></p>[swei]<p></p>vi.<p></p>摇动，摆动<p></p>歪，倾斜，偏向一边：<p></p>The tree has swayed down to the wall.<p></p>那棵树已歪倒在墙上。<p></p>to sway to the west<p></p>向西倾斜<p></p>(立场、意见等)倾向：<p></p>I swayed to my opponent's views in my deep heart.<p></p>在我内心深处，我倒倾向于我对手的观点。<p></p>to sway toward conservatism<p></p>倾向于保守主义<p></p>改变看法(或主意等)；动摇，摇摆不定：<p></p>His ideas swayed this way and that.<p></p>他的想法一会儿这样，一会儿又那样。<p></p>to sway between love and hate<p></p>又恨又爱<p></p>起支配作用；处于统治地位，做统治者<p></p>vt.<p></p>使摇摆；使(前后)摆动<p></p>使倾斜，弄歪，使偏向一侧：<p></p>The bonnet was swayed on her head.<p></p>那顶小圆软帽歪戴在她的头上。<p></p>The bridge is swayed to the west.<p></p>该桥已向西歪斜了。<p></p>【航海学】扯起(帆桁)(常与up连用)<p></p>使动摇；使犹豫；使改变主意(或意见等)：<p></p>What has swayed your decision?<p></p>什么事让你犹豫，使你不敢做出决定?<p></p>I can sway him.<p></p>我能让他改变主意。<p></p>使倾向于<p></p>影响，支配(人、思想、情绪等)：<p></p>His works swayed the descendants deeply.<p></p>他的作品深深地影响着后人。<p></p>to be swayed by others<p></p>受他人支配<p></p>[古语]挥动；挥舞(武器等)：<p></p>to sway a sword in one's hand<p></p>挥舞手中的剑<p></p>[诗歌用语、古语](作为君主)统治：<p></p>He sways the whole Rome.<p></p>他统治着整个罗马帝国。<p></p>n.<p></p>摇摆，摇动<p></p>【航海学】摇动，摇晃<p></p>歪斜，倾斜；改变方向<p></p>统治；支配<p></p>势力，权势；统治地位<p></p>支配的力量(或影响)<p></p>近义词:<p></p>affect<p></p>短语:<p></p>bear(或hold) sway (over)<p></p>有支配(…的)权力；有左右(…的)力量<p></p>under the sway of<p></p>在…支配之下；在…影响下[亦作under someone's sway]</p></body></html>",
