  ["swoopers"] = "<html><body><h1>swoopers</h1><p>swooper<p></p>n.<p></p>swoop的变形<p></p>swoop<p></p>[swu:p]<p></p>vi.<p></p>(鹰等捕捉猎物时)飞扑，猛扑：<p></p>The owl swooped down on a mouse.<p></p>猫头鹰向一只老鼠飞扑过去。<p></p>骤然下降，空然下落：<p></p>My plane swooped from 20,000 metres to 500 metres.<p></p>我驾机从二万米高空一下子骤降至500米的低空。<p></p>奇袭，突然袭击：<p></p>My troops swooped down on the city.<p></p>我的部队奇袭该城，并一举攻下。<p></p>vt.<p></p>抢走，突然抓起，攫取(与 away，off 或 up 连用)：<p></p>He swooped the money out of my hand.<p></p>他从我手中把钱抢走了。<p></p>He swooped her up in his arms.<p></p>他猛地把她拥在怀里。<p></p>(突然)把…取出(或移动、除去等)：<p></p>She swooped a small gun and pointed at me.<p></p>她突然掏出一把小手枪并指向我。<p></p>(飞扑时)画出：<p></p>His plane swooped a beautiful curve up and down.<p></p>他的飞机在上下翻飞时画出了一条美丽的曲线。<p></p>吸食，吮吸：<p></p>to swoop soda water with a suck<p></p>用吸管吸饮汽水<p></p>[废语]扫除<p></p>n.<p></p>飞扑，猛扑<p></p>波浪形的飞舞；波形线<p></p>攫取，抓取<p></p>突然，突然行动<p></p>短语:<p></p>at(或 in)one(fell)swoop<p></p>刹那间<p></p>一下子，一举</p></body></html>",
